  return (

    <section className="hero-section">
    <Container fluid>
      <Row>
        <Col>
          {/* Responsive Hero Image */}
          <img
            src={img}  // Replace with the path to your actual image
            alt="Hero Image"
            className="img-fluid"
          />
        </Col>
      </Row>
    </Container>
  </section>

  );
};

export default Home;
